function randomName()
	local n1s, n2s = names, namePrefixs
	if LOCAL_LANGUAGE == 'tw' then
		n1s, n2s = twNames, twNamePrefixs
	elseif LOCAL_LANGUAGE == 'en' then
		n1s, n2s = enNames, enNamePrefixs
	end

    n1 = _random(1, #n1s)
    n2 = _random(1, #n2s)
    local ret
    if LOCAL_LANGUAGE == 'en' then
    	ret = string.format("%s %s", n2s[n2], n1s[n1])
    else
    	ret = n2s[n2] .. n1s[n1]
    end
    if #ret > 18 then
    	return randomName()
    end
    return ret
end

